    <body>
        <div class="mui-container">
            <h1>
                Z&aacute;kladn&iacute; deska
            </h1>
            <ul>
                <li>
                    Z&aacute;kladn&iacute; hardware poč&iacute;tače, kter&aacute; obsahuje elektrick&eacute; obvody a konektory
                </li>
                <li>
                    Jej&iacute;m &uacute;kolem je propojit jednotliv&eacute; č&aacute;sti poč&iacute;tače
                </li>
                <li>
                    Sběrnice a obvody poskytuj&iacute; nap&aacute;jen&iacute; a komunikaci ostatn&iacute;ch komponent
                </li>
                <li>
                    Funkce z&aacute;kladn&iacute; desky se roz&scaron;&iacute;řily o funkce, kter&eacute; se dř&iacute;ve připojovaly pomoc&iacute; př&iacute;davn&yacute;ch karet
                </li>
            </ul>
            <h2>
                Chipset = chipov&aacute; sada
            </h2>
            <ul>
                <li>
                    Nejdůležitěj&scaron;&iacute; integrovan&eacute; obvody z&aacute;kladn&aacute; desky
                </li>
                <li>
                    Určuje jak&yacute; typ procesoru a paměť mohu připojit
                </li>
                <li>
                    Tvořena buď jedn&iacute;m, nebo dvěma chipy (severn&iacute; a jižn&iacute; můstek)
                </li>
            </ul>
            <h3>
                Severn&iacute; můstek = Northbridge
            </h3>
            <ul>
                <li>
                    Komunikace mezi procesorem, grafickou kartou a pamět&iacute;
                </li>
                <li>
                    Zvl&aacute;dal pracovat pouze s&nbsp;p&aacute;r typy procesorů a pamět&iacute;
                </li>
                <li>
                    Propojen s&nbsp;jižn&iacute;m můstkem
                </li>
            </ul>
            <h3>
                Jižn&iacute; můstek = Southbridge
            </h3>
            <ul>
                <li>
                    Realizuje pomalej&scaron;&iacute; funkce
                </li>
                <li>
                    Nen&iacute; připojen s procesorem
                </li>
                <li>
                    PCI, DMA, disky, USB, Ethernet, SATA, FireWire
                </li>
            </ul>
            <h3>
                Blokov&eacute; sch&eacute;ma z&aacute;kladn&iacute; desky
            </h3>
            <p>
                <img src="data:image/png;base64,">
            </p>
            <ul>
                <li>
                    <strong>
                        Clock Generator
                    </strong>
                    &ndash; gener&aacute;tor hodinov&eacute;ho kmitočtu, použ&iacute;v&aacute; se pro synchronizaci operac&iacute; v&nbsp;integrovan&yacute;ch obvodech
                </li>
                <li>
                    <strong>
                        Timecounter
                    </strong>
                    &ndash; časovač sč&iacute;tač, vytv&aacute;ř&iacute; zpožděn&iacute;, poč&iacute;t&aacute; ud&aacute;losti, nez&aacute;visl&yacute; na CPU
                </li>
                <li>
                    <strong>
                        CMOS paměť
                    </strong>
                    &ndash; operačn&iacute; paměť a BIOS m&aacute; jeden adresov&yacute; prostor
                </li>
                <li>
                    <strong>
                        Super I/O chip
                    </strong>
                    &ndash; skupina komunikačn&iacute;ch zař&iacute;zen&iacute; (kl&aacute;vesnice, my&scaron;&hellip;)
                </li>
            </ul>
            <h3>
                Sch&eacute;ma procesoru
            </h3>
            <p>
                <img src="data:image/png;base64,">
            </p>
            <ul>
                <li>
                    Dř&iacute;ve byl ŘADIČ sběrnice souč&aacute;st&iacute; severn&iacute;ho můstku
                </li>
                <li>
                    Rychlej&scaron;&iacute; než se severn&iacute;m můstkem
                </li>
            </ul>
            <h3>
                Typy z&aacute;kladn&iacute;ch podle velikosti a uspoř&aacute;d&aacute;n&iacute;
            </h3>
            <h4>
                AT (Advanced Technology)
            </h4>
            <ul>
                <li>
                    Použ&iacute;val zdroj AT &ndash; měl dvoj&iacute; nap&aacute;jen&iacute;, buď 5V nebo 12V
                </li>
            </ul>
            <h4>
                ATX
            </h4>
            <ul>
                <li>
                    Nejpouž&iacute;vaněj&scaron;&iacute; typ desky, poj&iacute; se zdrojem
                    <strong>
                        ATX
                    </strong>
                </li>
            </ul>
            <h5>
                Zdroj ATX
            </h5>
            <ul>
                <li>
                    <ul>
                        <li>
                            Přizpůsoben desce ATX
                        </li>
                        <li>
                            Dod&aacute;v&aacute; tři napěťov&eacute; &uacute;rovně 3,3V, 5V a 12V
                        </li>
                        <li>
                            Připojen 20 nebo 24 pinov&yacute;m konektorem
                        </li>
                        <li>
                            Zap&iacute;n&aacute;n&iacute; a vyp&iacute;nan&iacute; je realizov&aacute;no obvodem na z&aacute;kladn&iacute; desce
                        </li>
                        <li>
                            Je připojen do s&iacute;tě a st&aacute;le spotřebov&aacute;v&aacute; napět&iacute;
                        </li>
                        <li>
                            Můžu poč&iacute;tač zapnout např. my&scaron;&iacute; a kl&aacute;vesnic&iacute;
                        </li>
                        <li>
                            Stand-by a soft-off &ndash; můžu zapnout PC na d&aacute;lku
                        </li>
                    </ul>
                </li>
            </ul>
            <h4>
                BTX
            </h4>
            <ul>
                <li>
                    Podobn&aacute; ATX
                </li>
            </ul>
            <h2>
                BIOS (Basic Input-Output Syst&eacute;m)
            </h2>
            <ul>
                <li>
                    Z&aacute;kladn&iacute; vstupně-v&yacute;stupn&iacute; funkce PC
                </li>
                <li>
                    Automaticky spu&scaron;těn z&aacute;kladn&iacute; deskou při spu&scaron;těn&iacute; PC
                </li>
                <li>
                    Zaji&scaron;ťuje komunikaci mezi hardwarem a softwarem a spou&scaron;t&iacute; OS
                </li>
                <li>
                    Načte konfiguraci z&nbsp;CMOS paměti
                </li>
                <li>
                    K&nbsp;nastaven&iacute; BIOSu se spust&iacute; SETUP
                </li>
            </ul>
            <h5>
                SETUP
            </h5>
            <ul>
                <li>
                    <ul>
                        <li>
                            Takt
                        </li>
                        <li>
                            Paměti cache
                        </li>
                        <li>
                            Hardware monitor
                        </li>
                        <li>
                            Power management
                        </li>
                    </ul>
                </li>
                <li>
                    Původně byl BIOS v&nbsp;ROM paměti později EEPROM a FLASH ROM
                </li>
            </ul>
            <p>
                Dual Bios
            </p>
            <ul>
                <li>
                    č&aacute;st BIOSu se při aktualizaci neměn&iacute; a č&aacute;st se aktualizuje (m&aacute;me z&aacute;lohu v&nbsp;př&iacute;padě, že by se něco pokazilo
                </li>
            </ul>
            <h3>
                Technologie UEFI
            </h3>
            <ul>
                <li>
                    V&nbsp;roce 2008 pře&scaron;lo na technologii UEFI mnoho syst&eacute;mu platformy x64
                </li>
                <li>
                    Tzv. 3D BIOS &ndash; plně interaktivn&iacute; uživatelsk&eacute; rozhran&iacute;
                </li>
            </ul>
            <ol>
                <li>
                    Vrstva
                    <ul>
                        <li>
                            Uložena ve FLASH ROM paměti
                        </li>
                        <li>
                            Detekuje se druh CPU, paměti
                        </li>
                    </ul>
                </li>
                <li>
                    Vrstva
                    <ul>
                        <li>
                            CMOS
                        </li>
                        <li>
                            Kapacita HDD, cache, ochrana PC
                        </li>
                    </ul>
                </li>
                <li>
                    Vrstva
                    <ul>
                        <li>
                            Ovladače, kter&eacute; zav&aacute;d&iacute; v&nbsp;průběhu spu&scaron;těn&iacute; OS
                        </li>
                        <li>
                            Př&iacute;mo na desce nebo na kart&aacute;ch
                        </li>
                    </ul>
                </li>
            </ol>
